  \"integrated-motion-planning-and-autonomous-control-technology-for-autonomous-isr-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"SSCI and MIT propose to design, implement
  and test a comprehensive Integrated Mission Planning &amp; Autonomous Control Technology
  (IMPACT) for Autonomous ISR missions employing collaborating Unmanned Aerial Vehicles
  (UAV). The main feature of the IMPACT system for Autonomous ISR is that it is based
  on robust real-time learning about dynamic and stochastic environments, and on a
  capability to autonomously react to contingencies while satisfying the mission objectives
  and the overall flight safety. The project will leverage a number of technologies
  recently developed by SSCI and  MIT, and integrate various system modules within
  a flexible and user-friendly framework. In order to achieve the project objectives,
  the following tasks will be carried out: (i) Problem Statement &amp; Test Scenario
  Selection jointly with NASA; (ii) Develop, Implement &amp; Test Vehicle-level Subsystems;
  (iii) Develop, Implement &amp; Test Mission-level Subsystems; and (iii) Carry out
  \ Integration &amp; Initial Testing of the overall IMPACT System for an Autonomous
  ISR mission. Phase II of the project will be focused on the enhancements and full
  implementation of the IMPACT system, prototype system development, and demonstration
  of its features through hardware-in-the-loop simulations and flight tests at MIT.\",\n\t\"license_title\":
